; /* Start:"a:4:{s:4:"full";s:98:"/local/templates/re-store-vue/components/multisite/city.selector/.default/script.js?16109925494248";s:6:"source";s:83:"/local/templates/re-store-vue/components/multisite/city.selector/.default/script.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
function selectCity(city) {
    $.ajax({
        type: "POST",
        url: "/local/components/multisite/city.selector/ajax.php",
        data: {action: 'selectCity', city: city, "action": "changeCityUser"},
        success: function (result) {
            var obj = jQuery.parseJSON(result);
            if(obj.status){
                return true;
            }
        }
    });
}

function changeCity(city, cityID){
    $.ajax({
        type: "POST",
        url: "/local/components/multisite/city.selector/ajax.php",
        data: {city: city, url:location.href, city_id: cityID, "action": "changeCity"},
        success: function (result) {
            var obj = jQuery.parseJSON(result);

            if (typeof obj.ddlWebsite !=='undefined'){
                $(document).trigger('change-city',obj.ddlWebsite);
            }

            if(obj.status){
                window.location.reload();
            }
        }
    });
}

$(document).on('click', ".city-selector-link", function(){
    $('.choose-city-list').hide();
    $('body').removeClass('hidden');
    var city = $(this).attr('data-city') ? $(this).attr('data-city') : $(this).html();
    changeCity(city);

    return false;
});

$(document).on('click', ".gray-bttn-normal.button-city", function(event, parameters){
    if (typeof parameters !== "undefined") {
        var city = parameters.cityVal;
        var cityID = parameters.cityID;
    } else {
        var city = $(this).parent().children('input[name="search_city"]').val();
        var cityID = 0;
    }
    changeCity(city, cityID);
});

var citySearchTimeout;
var citySearchAjax;
$(document).on('input', '.location-search__input',function(){
    $('input[name="search_city"]').data('long', 'Другой');

    if (citySearchAjax) {
        citySearchAjax.abort();
    }

    if (citySearchTimeout) {
        clearTimeout(citySearchTimeout);
    }

    var $this = $(this);
    if ( $this.val().length >= 2 ) {
        citySearchTimeout = setTimeout(function() {
            var template_path = $this.siblings('.template_path').val(),
                query = $this.val();
            citySearchAjax = $.ajax({
                type: "POST",
                url: "/local/components/multisite/city.selector/ajax.php",
                data: {query: query, "action": "changeCity"},
                success: function (result) {
                    var obj = jQuery.parseJSON(result);
                    $('.city-select-mod').empty();
                    obj.cities.forEach(function(item, i, arr) {
                        var city_container = $('.city-select-mod');
                        city_container.append('<div class="service-opened-oneblock">'+item+'</div>');
                        $('.city-select-mod').html(city_container.html());
                    });
                    if(obj.cities.length) {$('.service-opened').show();
                        $('div.service-opened-oneblock').on('click', function(){
                            $('input[name="search_city"]').val($(this).children('span.normal-p').text());
                            $('input[name="search_city"]').data('long', $(this).children('span.normal-p').data('city-name'));
                            //changeCity($('input[name="search_city"]').val());
                            $('.city-select-mod').hide();

                            var parameters = {
                                cityVal: $(this).children('span.normal-p').data('city-name'),
                                cityID: $(this).children('span.normal-p').attr('data-city-id')
                            };

                            $('.choose-city-list-cont .service-price-input button.button-city').trigger('click',parameters);
                        });
                    } else {
                        $('.city-select-mod').hide();
                    }
                }
            });

        }, 300);
    } else {
        $('.city-select-mod').hide();
    }
});

$('div.service-price-input').on('focusout',function(){
    setTimeout(function(){ $('.city-select-mod').hide(); },300);
});
$(document).on('click', '.service-opened-oneblock span', function() {
    $('.service-price-input .location-search__input').val($(this).attr('data-city-name'))
})

