    $(document).on('promo-code', function (event, response, promocode) {
        if (typeof response !== 'undefined') {
            let name = '';
            if (response.status) {
                name = 'Промокод действителен';
            } else {
                name = response.errors['PROMOCODE']? response.errors['PROMOCODE']:'';
            }

            let eventOptions = {
                category: 'Promo code',
                name: name, //статус
                label: promocode || '', //промокод
            };

            DDLEvent.add('', eventOptions);
            //console.log("Promo_code", response, promocode, eventOptions)
        }

    });


