	document.addEventListener('applied-filter', function(event) {
		// сначала удалим все предыдущие значения применённых фильтров
		DDLEvent.remove('category', 'catalog_filters');

		for (let key in event.detail) {
			// все, кроме диапазона цены
			if (key !== 'max_price' && key !== 'min_price') {
				for (let i = 0; i < event.detail[key].items.length; i++) {
					let currentEntry = event.detail[key].items[i];
					let options = {};
					if (currentEntry.checked) {
						options.action = event.detail[key].name;
						options.label = currentEntry.text;
						DDLEvent.add('AppliedFilter', options);
					}
				}
			}
		}

		// Ценовой диапазон
		// если изменено хотя бы одно крайнее значение
		if (event.detail.min_price.value !== null || event.detail.max_price.value !== null) {
			let options = {action: 'Цена', label: ''};
			let min = 0, max = 0;
			if (event.detail.min_price.value !== null) {
				min = event.detail.min_price.value;
			} else {
				min = event.detail.min_price.placeholder.replace(/\D/g, '');
			}
			if (event.detail.max_price.value !== null) {
				max = event.detail.max_price.value;
			} else {
				max = event.detail.max_price.placeholder.replace(/\D/g, '');
			}
			options.label = min + ' - ' + max;
			DDLEvent.add('AppliedFilter', options);
		}
	});

